  - name: TEXT4000
    number: '4'
    value: This amendment is in response to your letter stating a concern with the
      Amended 12 Day Pre-Special Report filed by GROWPAC (formerly known as American
      Renewal PAC).  In your letter dated February 6
  - value: ' 2002'
  - value: ' your report indicates a few concerns.  Please find an attached Schedule
      H3 to support the entry reported on Line 18 of the Detailed Summary Page.  Also
      please find that there is an amended Schedule H4 that clarifies the information
      concerning the memo entries and that also shows the disclosed disbursements
      for the Fundraising category which the ration is disclosed on Schedule H2.  Your
      report also indicates that we did not disclose limited payments for administrative
      expenses.  This is not correct.  Grow PAC does not have an office accruing administrative
      expenses such as telephone'
  - value: ' electricity'
  - value: ' and rent.  These expenses are accrued by our consultant. Morgan'
  - value: ' Meredith & Associates'
  - value: ' and are incorporating in their consulting fees.  You will see in our
      report disbursements made to Morgan'
  - value: ' Meredith & Associates.  If the situation were to change'
  - value: ' we would notify you immediately as we begin to pay these expenses directly.  Until
      then'
  - value: ' please be aware that these expenses will not be reflected on any of our
      disbursement reports.  Please also find an amended Schedule B providing address
      for each disbursement itemized.  The committee has taken the necessary steps
      so this will not happen in the future.  If you have any further questions please
      let us know.'
